import React from 'react';
import './NewMultiItemCarousel.css'

import { Link } from "react-router-dom";

import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';

import pic1 from '../images/multiCarousel/c1.jpg'
import pic2 from '../images/multiCarousel/c2.jpg'
import pic3 from '../images/multiCarousel/c3.jpg'
import pic4 from '../images/multiCarousel/c4.jpg'
import pic5 from '../images/multiCarousel/c5.jpg'
import pic6 from '../images/multiCarousel/c6.jpg'
import loggedReducer from "../../reducers/isSigned";


const NewMultiItemCarousel = () => {
    var vw;
    var vh;
    var imageHeight= window.innerHeight;
    vh = imageHeight/4 - (imageHeight/100) + 'px';

    const viewWidth = () => {

        var imageHeight= window.innerHeight;
        vh = imageHeight/4 + 'px';

        console.log(imageHeight)
        console.log(vh)
    };

    return(
        <Carousel
            className="pt-4"
            arrows
            slidesPerPage={6}
            slidesPerScroll={1}
            infinite
            keepDirectionWhenDragging
            breakpoints={{
                // smaller than
                1200: {
                    slidesPerPage: 5,
                    // arrows: false,
                },
                1024: {
                    slidesPerPage: 4,
                    // arrows: false,
                },
                720: {
                    slidesPerPage: 3,
                    arrows: false,
                    infinite: false
                },
                500: {
                    slidesPerPage: 2,
                    arrows: false,
                    // centered: true
                    infinite: false
                }

            }}
        >

            <div>
                <img src={pic1} style={{ height: vh}}/>
                <div className=" text-center d-block">
                    <h5>TODAY'S</h5>
                    <p>TOP HITS</p>
                </div>
            </div>
            <div>
                <img src={pic2} style={{ height: vh}}/>
                <div className=" text-center d-block">
                    <h5>TODAY'S</h5>
                    <p>TOP HITS</p>
                </div>
            </div>
            <div>
                <img src={pic3} style={{ height: vh}}/>
                <div className=" text-center d-block">
                    <h5>TODAY'S</h5>
                    <p>TOP HITS</p>
                </div>
            </div>
            <div>
                <img src={pic4} style={{ height: vh}}/>
                <div className=" text-center d-block">
                    <h5>TODAY'S</h5>
                    <p>TOP HITS</p>
                </div>
            </div>
            <div>
                <img src={pic5} style={{ height: vh}}/>
                <div className=" text-center d-block">
                    <h5>TODAY'S</h5>
                    <p>TOP HITS</p>
                </div>
            </div>
            <div>
                <img src={pic6} style={{ height: vh}}/>
                <div className=" text-center d-block">
                    <h5>TODAY'S</h5>
                    <p>TOP HITS</p>
                </div>
            </div>


            {/*<img src={pic2} style={{ height: vh}} />*/}
            {/*<img src={pic3} style={{ height: vh}} />*/}
            {/*<img src={pic4} style={{ height: vh}} />*/}
            {/*<img src={pic5} style={{ height: vh}} />*/}
            {/*<img src={pic6} style={{ height: vh}} />*/}
        </Carousel>
    );
}

export default NewMultiItemCarousel;
